import React from "react";
import "./App.css";
import Header from "./components/Header";
import Game from "./components/Game";

function App(props) {
  const [count, setCount] = React.useState(0);

  const passCount = (count) => {
    setCount(count);
  };

  return (
    <div className="App">
      <Header />
      <Game passCount={passCount} />
      <p>Your tries: {count}</p>
    </div>
  );
}

export default App;
